import PropTypes from 'prop-types';

export default class Email extends Component{

render(){
    return(
        <div class="boxWrapped"> 
        <div class= "boxHolder">
            <div class="boxSend"> from: <br/>{email.sender}</div>
            <div class="boxRec"> to: <br/>{email.recipient}</div>
        </div>
        <div class= "boxHolder">
            <div class="boxSubject"> {email.subject}</div>
            <div class="boxDate"> {email.date}</div>
        </div>
            <div class="boxBody"> {email.message}</div>
        </div>
    )
}
}



Email.propTypes = {
    email : PropTypes.object    
}
